int main (void){
    /*SAMAR SETUP*/
    *gpio_direction_reg = 0x00000001; // set GPIO_1[0] as an output pin
    // *(ADC_ptr+1) = 0xFFFFFFFF;	// sets the ADC up to automatically perform conversions
    NIOS2_WRITE_IENABLE(0x1); //level 0 (interval timer)
    NIOS2_WRITE_STATUS(0x1); //enable Nios II interrupts
    timerConfig(1000); //initially configure the timer to enable interrupts and such 

    /*ANNIE SETUP*/
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    print_static();
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

    clear_char();
    print_static();

    while(1){
        /**********************************************SAMAR**********************************************/
        //read digital temperature via ADC
        *(ADC_ptr+1) = 0xFFFFFFFF;	// sets the ADC up to automatically perform conversions
        adcRead(); //update the current temperature 
        *LEDs = usage; //change this to display the current RPM 

        //update the speed based on the CPU usage 
        speed = (usage * 5124.0) / 100.0;
        printf("%d\n", speed);

        *LEDs = (int)(speed / 5.0);

        /**********************************************ANNIE ********************************************/
        clear_samar();
        // print_time();
        print_char();

        // printf("%d\n", temperature);
        print_samar(temperature, speed, usage);

        // keyboard stuff
        PS2_data = *(PS2_ptr);         // read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000);  // extract the RVALID field

        if (RVALID != 0) {
            /* always save the last three bytes received */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
        }

        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
        // mouse inserted; initialize sending of data
            *(PS2_ptr) = 0xF4;
        }
        // Display last byte on Red LEDs

        print_screen(byte3);

        if (blue_toggle == 1) {
            print_bsod();
            wait_for_vsync();
            audio(samples, 8150);
            break;
        }
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    }

    blue_toggle != blue_toggle;
    return 0; 

}

