void print_samar(int temperature, int speed, int usage) {
  char temp[10];  // Allocate memory for the string
  sprintf(temp, "%d", temperature);
  int s = 67;
  char *temp_ptr = temp;  // Pointer to the beginning of the string

  while (*temp_ptr) {
    write_char(s, 35, *temp_ptr);
    s++;
    temp_ptr++;
  }

  char fan_speed[10];  // Allocate memory for the string
  sprintf(fan_speed, "%d", speed);
  int f = 60;
  char *fan_speed_ptr = fan_speed;  // Pointer to the beginning of the string

  while (*fan_speed_ptr) {
    write_char(f, 18, *fan_speed_ptr);
    f++;
    fan_speed_ptr++;
  }

  char cpu_usage[10];  // Allocate memory for the string
  sprintf(cpu_usage, "%d", usage);
  int u = 63;
  char *cpu_ptr = cpu_usage;  // Pointer to the beginning of the string

  while (*cpu_ptr) {
    write_char(u, 45, *cpu_ptr);
    u++;
    cpu_ptr++;
  }

  printf("%s\n", temp);  // Print the entire string

}

